        history.push("/")
    })

    return (
        <div>
            <div>
                <h1>
                    <Link to="/signin">Login</Link>
                </h1>
                <h1>
                    <button onClick={authLogout}>Logout</button>
                </h1>
                <br />
                <h1>
                    <Link to="/signup">Signup</Link>
                </h1>
                <br />
                <h1>
                    <Link to="/listingpage">Add List</Link>
                </h1>
            </div>

            <br />
            <br />
            <br />

            <h2>{props.name ? `Welcome - ${props.name}` : "Login please"}</h2>
        </div>
    );
}

export default Home;
